      right: 'ctrl+alt+right',
      up: 'ctrl+alt+up',
      down: 'ctrl+alt+down',
      topleft: 'ctrl+alt+1',
      botleft: 'ctrl+alt+2',
      topright: 'ctrl+alt+3',
      botright: 'ctrl+alt+4',
